</tr><tr>
  <th width="94" align="center" bgcolor="#eeeeee"><font size="2" color="#343434">◇　材　質</font></th><td width="274" 
bgcolor="#ffffff"><font size="2" color="#454545">材質：PP　30L</font></td></tr><tr><th width="94" align="center" 
bgcolor="#eeeeee"><font size="2" color="#343434">◇　カラー</font></th>
<td width="274" bgcolor="#ffffff"><font size="2" 
color="#454545">KHAKI</font></td></tr><tr>
<th width="94" align="center" bgcolor="#eeeeee"><font size="2" 
color="#343434">◇　商　品</font></th>
<td width="274" bgcolor="#ffffff"><font size="2" color="#454545">
      たっぷり収納できて強度も十分なオリーブドラブカラーのコンテナー！<br>
        リビングの片隅に置いておくだけでも部屋の空間アレンジになって◎<br>
        サイズ違いでスタッキングし積み上げても雰囲気でていいと思います。<br>
        ガレージなどに使ったりも出来て、男性にもかなり人気です。<br>
車の中、ベッド下、クローゼットなど様々な場所で大活躍です。<br>
未使用時には折りたため、更にスタッキングもできるので、場所をとりません。<br>
</font></td></tr><tr><th width="94" align="center" bgcolor="#eeeeee">
<font size="2" color="#343434">◇　ご注意</font></th><td width="274" bgcolor="#ffffff"><font size="2" color="#454545">

<font size="2" color="red">※商品はメーカー他店舗との共有在庫のため、ご注文を賜っても、商品がご用意できない場合がございます。その場合は
ご連絡させて頂き、キャンセル処理させて頂きます。</font><br /><br>
※掲載画像は、出来る限り実物に近づけておりますが、ご使用の環境や設定により実際の商品と色味が異なる場合がございます。<br /><br>
※生産時期により色味やパーツの仕様が変わる場合がございます。<br /><br>
※当店で直送品以外の商品を複数購入される場合、
2箇所からの発送（当店・メーカー倉庫）となります。
配達日時・配送業者が異なります。予めご了承下さい。
送料に関しましては当店規定どおりです。<br>
<br>
※配送の日時指定ができかねます。お客様の方で運送会社へ
直接ご連絡頂けます様お願いいたします。
<br><br>
※北海道の方は+800円・別途送料がかかります。<br><br>
送料無料の商品でもプラス加算させて頂きます。
沖縄・離島の方はメーカー直送商品はご注文を賜る
ことが出来ません。予めご了承下さい。
どうしても欲しい場合は送料など一度ご相談下さい<br><br>
※メーカー直送商品となりますので返品・交換は一切対応
できません。破損商品などに関しては対応致します。
但し、アンティーク加工を施していますので
キズ・色ムラもあることもございます→
良品扱いとなります。<br>
